export default (function(a,b,c,d,e){return {data:{kfGrVZYG98:{data:{id:2392,attributes:{imdbId:"tt0365929",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNTEyMDgwNzU1NF5BMl5BanBnXkFtZTcwMDkxMzI4Mg@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.5\u002F10"},{Source:"Rotten Tomatoes",Value:"7%"}],item_lang:{data:{id:3055,attributes:{title:d,plot:"U.S. Marshal Carrie Stetko is three days from the end of her tour at an international research station in Antarctica after which she'll resign. An incident from her past haunts her. The continent's first winter storm is coming when a body, wearing no gear, is discovered in the tundra. She investigates, soon finds more bodies, and must find a motive and a murderer before the storm and her departure. A U.N. agent, Robert Pryce, appears, seemingly out of nowhere, to help. An aging physician about to retire, a nervous mission chief, a downed Soviet plane, and the weather's deadly elements add to the story. Can Carrie trust Pryce and does she still have what it takes?",slug:"whiteout"}}},books:{data:[{id:1490,attributes:{title:"Whiteout Compendium",description:"The critically acclaimed and Eisner-winning WHITEOUT graphic novels from Greg Rucka (LAZARUS, WONDER WOMAN) & Steve Lieber (THE FIX, SUPERIOR FOES) return in this new compendium! Carrie Stetko is a US Marshal tasked with enforcing the law in one of the most remote and inhospitable places on earth―Antarctica. Collects WHITEOUT and WHITEOUT: MELT under one cover!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pE0vtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2017-12-19",publisher:e,subtitle:a}},{id:1491,attributes:{title:"Whiteout, Vol. 1, Definitive Edition",description:"You can't get any further down than the bottom of the world - Antarctica. Cold, desolate, nothing but ice and snow for miles and miles. Carrie Stetko is a U.S. Marshal, and she's made The Ice her home. In its vastness, she has found a place where she can forget her troubled past and feel at peace... Until someone commits a murder in her jurisdiction and that peace is shattered. The murderer is one of five men scattered across the continent, and he has more reason to hide than just the slaying. Several ice samples were taken from the area around the body, and the depth of the drilling signifies something particular was removed. Enter Lily Sharpe, who wants to know what was so important another man's life had to be taken for it. But are either of the women prepared for the secrets and betrayals at the core of the situation?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7FjABAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2007-05-01",publisher:e,subtitle:a}},{id:1492,attributes:{title:d,description:"WHITEOUT:MELT reúne a Greg Rucka (ATTICUS KODIAK:EL GUARDIÁN, BATMAN: EL SEÑOR DE LA NOCHE ) con el genial ilustrador Steve Lieber, para presentar una nueva aventura de Carrie Stetk, la marshal destinada a la Antártida, que se ha convertido en lectura obligatoria para todos los aficionados a la novela negra y a las buenas historias de detectives.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OMyqGgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"Steve Lieber"],firstBook:c,published:"2005-01-01",publisher:a,subtitle:"melt"}},{id:1493,attributes:{title:d,description:a,thumbnail:a,authors:[b],firstBook:c,published:"1998-01-01",publisher:a,subtitle:a}},{id:1494,attributes:{title:"Whiteout Vol. 2: Melt, Definitive Edition",description:"One of Oni Press' earliest and most acclaimed books returns in a brand new re-mastered and re-formatted edition! The sequel to the original groundbreaking series, Whiteout: Melt reteams author Greg Rucka (Batman: No Man's Land, the Atticus Kodiak novels) and illustrator Steve Lieber (Grendel Tales) for another adventure with U.S. Marshall Carrie Stetko on the deadly ice of Antarctica. Winner of a 1999 Eisner Award, Whiteout: Melt is a must-have for the bookshelves of fans of crime fiction and intense graphic storytelling.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gFnABAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2007-09-01",publisher:e,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940923281}}("","Greg Rucka",null,"Whiteout","Oni Press"))